import './App.css';



function Button() {
  return (
    <>
      <div className="d-grid gap-2 d-md-flex  btn-group-vertical" id="button-container">
      <button type="button" className="btn btn-outline-dark btn-lg " style={{ marginTop:"20px" }}>
         Silico Manganese Slag
        </button>
        <button type="button" className="btn btn-outline-dark btn-lg" style={{ marginTop:"20px" }}>
          Crusher Dust
        </button>
        <button type="button" className="btn btn-outline-dark btn-lg " style={{ marginTop:"20px" }}>
          Iron Ore
        </button>
      </div>
    </>
  );
}

export default Button;
